import React from "react";

import "./EmailBox.css";
import "../../App.css";

const EmailBox = () => {
  return (
    <>
      <section className="emailbox" id="emailbox">
        <div className="container d_flex">div.email_box</div>
      </section>
    </>
  );
};

export default EmailBox;
